function RatingModel(initialRatings){console.log(initialRatings);var self=this;self.ratings=ko.observable({general:initialRatings&&initialRatings.general?initialRatings.general:undefined,ambiance:initialRatings&&initialRatings.ambiance?initialRatings.ambiance:undefined,atmosphere:initialRatings&&initialRatings.atmosphere?initialRatings.atmosphere:undefined,food:initialRatings&&initialRatings.food?initialRatings.food:undefined,hygiene:initialRatings&&initialRatings.hygiene?initialRatings.hygiene:undefined,pricing:initialRatings&&initialRatings.pricing?initialRatings.pricing:undefined,service:initialRatings&&initialRatings.service?initialRatings.service:undefined});self.setRating=function(ratingName,ratingValue){self.ratings()[ratingName]=ratingValue};self.getRating=function(ratingName){return self.ratings()[ratingName]}}